export interface colourTemplate {
    background1: string;
    background2: string;
    font1: string;
    font2: string;
    font3: string;
}

export const colours: colourTemplate = {
    background1: "#e9f7f1", //"#e4ebeb"
    background2: "#FFFFFF",
    font1: "#255", //2c5194 //A4381D
    font2: "#DB9FB9", //967253 //EB6949
    font3: "#000000",
};
